import React from 'react';

function Header() {
  return (
    <header style={{ textAlign: 'center', padding: '20px' }}>
      <h1 style={{ color: '#2c3e50', fontSize: '2rem' }}>MeetingBot</h1>
      <p style={{ color: '#7f8c8d' }}>Transform meeting transcripts into actionable summaries and tasks with AI</p>
    </header>
  );
}

export default Header;
